import './css_components/ComingSoon.css';

function ComingSoon () {
    return (
        <div className="coming_soon">
            <h1>Coming Soon!</h1>
            <span>This page is under contruction for now. Stay tuned!</span>
        </div>
    );
}

export default ComingSoon;
